import "./App.css";
import KeyVending from "./Component/KeyVending";
import ScreenVending from "./Component/ScreenVending";
import WaterVending from "./Component/WaterVendingMachine";
function App() {
  return (
    <div
      style={
        ({ display: "gridTemplateColumns" },
        { gridTemplateColumns: "60% auto" })
      }
    >
      <WaterVending />
      <>
        <ScreenVending />
        <KeyVending />
      </>
    </div>
  );
}

export default App;
